import React from 'react'

const NotFound = () => {
  return (
    <div>
      <div>
        <img style={{width: "100vw", marginTop: "80px", opacity: "0.9"}} src='https://curiocity.com/wp-content/uploads/2024/01/Cineplex-Popcorn-Bag-Fill-Billingual.jpg'/>
      </div>
      <div className='NotFound-num'>404</div>
      <div className='NotFound-explain'>Oops This page does not exist</div>
    </div>
  )
}

export default NotFound
